import React from "react";
import { withRouter, Link } from "react-router-dom";

function Intro() {
  return (
    <>
    <div className="fade">
      <div className="container">
      <h1>Xmas</h1>
        <Link to="/xmaspiano">

            <img src="/logo.jpg" alt="Logo" width="50%">
            </img>

        </Link>
        <h1>Piano</h1>
        </div>
      </div>
    </>
  );
}

export default withRouter(Intro);
